import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

const apiUrl = process.env.REACT_APP_API_URL;

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// –í—ã–≤–æ–¥–∏–º URL –¥–ª—è –ª–æ–∫–∞–ª—å–Ω–æ–≥–æ –¥–æ—Å—Ç—É–ø–∞
console.log(
  `üñ•Ô∏è  –õ–æ–∫–∞–ª—å–Ω—ã–π –∞–¥—Ä–µ—Å: ${window.location.href}\n` +
  `üîå –ï—Å–ª–∏ —Å–µ—Ä–≤–µ—Ä –∑–∞–ø—É—â–µ–Ω –Ω–∞ 0.0.0.0 –∏–ª–∏ –ª–æ–∫–∞–ª—å–Ω–æ–º IP, –º–æ–∂–Ω–æ –ø–æ–ø—Ä–æ–±–æ–≤–∞—Ç—å:\n` +
  `http://${getLocalIp()}:${window.location.port || 3000}`
);

// –§—É–Ω–∫—Ü–∏—è –¥–ª—è –ø–æ–ª—É—á–µ–Ω–∏—è –ª–æ–∫–∞–ª—å–Ω–æ–≥–æ IP (–Ω–µ –≤—Å–µ–≥–¥–∞ —Ä–∞–±–æ—Ç–∞–µ—Ç –≤ –±—Ä–∞—É–∑–µ—Ä–µ)
function getLocalIp() {
  // –í –±—Ä–∞—É–∑–µ—Ä–µ –Ω–µ—Ç –ø—Ä—è–º–æ–≥–æ –¥–æ—Å—Ç—É–ø–∞ –∫ IP, –Ω–æ –º–æ–∂–Ω–æ –ø–æ–ø—Ä–æ–±–æ–≤–∞—Ç—å WebRTC (–Ω–µ–Ω–∞–¥–µ–∂–Ω–æ)
  return "192.168.1.XXX"; // üëà –ó–∞–º–µ–Ω–∏ –≤—Ä—É—á–Ω—É—é –Ω–∞ —Å–≤–æ–π IP (ipconfig / ifconfig)
}
